function I = fcnK0R(S, T, u, alpha, F, tol)
t1 = 0.1e1 ./ u;t2 = S .* u;t3 = -t2 + u;t4 = 0.1e1 ./ t3;t5 = t4 .* t1;t6 = sqrt(-u);t7 = F - t6;t8 = 0.1e1 ./ t7;t9 = t7 .^ 2;t11 = t6 .* S;t12 = t7 .* t11;t15 = sqrt(t9 .* S + 0.2e1 .* t12 - t2 + u);t16 = 0.1e1 ./ t15;t20 = S .* t1;t21 = t3 .^ 2;t22 = 0.1e1 ./ t21;t23 = t22 .* t6;t27 = S .^ 2;t28 = t27 .* t1;t33 = sqrt(t3);t36 = 0.1e1 ./ t33 ./ t21 .* t6;t40 = log(0.2e1 .* t8 .* (t15 .* t33 + t12 - t2 + u));t44 = u .^ 2;t46 = t4 ./ t44;t51 = F + t6;t52 = 0.1e1 ./ t51;t53 = t51 .^ 2;t55 = t51 .* t11;t58 = sqrt(t53 .* S - t2 - 0.2e1 .* t55 + u);t59 = 0.1e1 ./ t58;t73 = log(0.2e1 .* t52 .* (t58 .* t33 - t2 - t55 + u));t82 = 0.1e1 ./ t6 .* t1;t87 = 0.1e1 ./ t33 ./ t3;t97 = t16 .* t8 .* t5 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t16 .* t23 .* t20 + 0.3e1 ./ 0.4e1 .* F .* t16 .* t22 .* t28 - 0.3e1 ./ 0.4e1 .* t40 .* t36 .* t20 + F .* S .* t16 .* t46 ./ 0.4e1 + t59 .* t52 .* t5 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t59 .* t23 .* t20 + 0.3e1 ./ 0.4e1 .* F .* t59 .* t22 .* t28 + 0.3e1 ./ 0.4e1 .* t73 .* t36 .* t20 + F .* S .* t59 .* t46 ./ 0.4e1 + t16 .* t4 .* t82 ./ 0.4e1 - t40 .* t87 .* t82 ./ 0.4e1 - t59 .* t4 .* t82 ./ 0.4e1 + t73 .* t87 .* t82 ./ 0.4e1;
I = t97(:,:,2) - t97(:,:,1);

